import React from 'react';
import "./static/css/App.css"
import  route  from "./router/index.js"
import { Switch,Route } from "react-router-dom"
function App() {
  console.log(route)
  return (
    <div>
       <Switch>
         {route.map((item,index)=>{
           return (
           <Route 
            key={index}
            path= {item.path}
            exact={item.exact}
            render= {(props)=>{
              props.username="sasa"
              item.render(props)
            }}
           />

           )
         })
         }
       </Switch>
    </div>
    );
}

export default App;
